const Damac = () => {
  return (
    <div className="wrap">
      <div className="damac">
        <div className="title">DAMAC Properties</div>
        <div className="description">
          Вы можете посмотреть проекты нашего партнера DAMAC Properties
        </div>
      </div>
    </div>
  );
};
export default Damac;
